    render() {
        return(
            <div>
                <h1><code>{'<h1> '}</code>Sources<code>{' </h1>'}</code></h1>
                <ul className="source-list">

                    <span style={{color: "green"}}>Description:&nbsp;</span>
                    <span style={{color: "#777777"}}>The name appearing animation in the Home tab.</span><br/>
                    <li>Ed, Dev, director. <span className="italic-text">SVG Animation With Text Tutorial | HTML CSS. YouTube</span>, 5 Dec. 2018,&nbsp;
                        <a href="www.youtube.com/watch?v=vJNVramny9k">www.youtube.com/watch?v=vJNVramny9k</a>.
                    </li><br/>

                    <span style={{color: "green"}}>Description:&nbsp;</span>
                    <span style={{color: "#777777"}}>Animated arrow linking to the About Me section.</span><br/>
                    <li>Naoya. “Demo: CSS Scroll down Button.”<span className="italic-text">CodePen</span>, 2019, &nbsp;
                        <a href="codepen.io/nxworld/pen/OyRrGy">codepen.io/nxworld/pen/OyRrGy</a>.
                    </li><br/>

                </ul>
                <h1><code>{'<h1> '}</code>Bug List<code>{' </h1>'}</code></h1>
            </div>
        )
    }
}

export default Sources
